function UserList() {
    const users = [
        {
            name:"Amit",
            salary:20000
        },
        {
            name:"Dan",
            salary:"30000"
        }
    ];

    return (
        <div>
            <table className="table">
                <thead>
                    <tr>
                    <th scope="col">Name</th>
                    <th scope="col">Salary</th>
                    </tr>
                </thead>
                <tbody>
                    {users.map((user, index) => {
                        return <tr key={index}>
                                <td>{user.name}</td>
                                <td>{user.salary}</td>
                            </tr>
                    }) }
                </tbody>
            </table>
        </div>
    )
}

export default UserList;
